entity moor is
    Port ( x : in  STD_LOGIC;
           y : out  STD_LOGIC;
           clockk : in  STD_LOGIC;
           resett : in  STD_LOGIC);
end moor;

architecture Behavioral of moor is
type state_type is (A, B, C, D, E, F, G);
signal state, next_state : state_type;

begin
process1 : process(clockk)
begin
if rising_edge(clockk)then
   if resett ='1' 
      then state<= A;
   else 
   state <= next_state;
   end if;
end if;
end process process1;

process2 : process(state, x)
begin
next_state <= state;
case state is 

when A=>
if x='0' then 
next_state <= B;
end if;

when B=>
if x='1' then
next_state <=C;
else 
next_state <=A;
end if;

when C=>
if x='1' then
next_state <=D;
else 
next_state <=B;
end if;

when D=>
if x='0' then
next_state <=E;
else 
next_state <=A;
end if;

when E=>
if x='0' then
next_state <=F;
else 
next_state <=C;
end if;

when F=>
if x='0' then
next_state <=G;
else 
next_state <=C;
end if;

when G=>
if x='1' then
next_state <=A;
else 
next_state <=B;
end if;
end case;
end process process2;

y<='1' when state = G
else '0';

end Behavioral;

